import React from 'react';

import { Doughnut } from 'react-chartjs-2';

const Time = () => {
    // Chart 1
    const data1 = {
        labels: ["Red", "Orange", "Green"],
        datasets: [
            {
                label: '',
                data: [33, 33, 33],
                backgroundColor: [
                    'rgba(231, 76, 60, 1)',
                    'rgba(255, 164, 46, 1)',
                    'rgba(46, 204, 113, 1)'
                ],
                borderColor: [
                    'rgba(255, 255, 255 ,1)',
                    'rgba(255, 255, 255 ,1)',
                    'rgba(255, 255, 255 ,1)'
                ],
                borderWidth: 5
            }
        ]
    };

    const options1 = {
        cutoutPercentage: '95%',
        rotation: -30 * Math.PI,
        circumference: 60 * Math.PI,
        legend: {
            display: false
        },
        tooltips: {
            enabled: false
        },
        //cutoutPercentage: 95
    };

   

    const options2 = {
        cutoutPercentage: '95%',
        rotation: -30 * Math.PI,
        circumference: 60 * Math.PI,
        legend: {
            display: false
        },
        tooltips: {
            enabled: false
        }
    };

    return (
        <div style={{ position: 'relative', width: '600px', height: '400px' }}>
            <Doughnut data={data1} options={options1} />
        </div>
    );
};

export default Time;
